import React, { Component } from "react";
import "./App.css";
import CardList from "./CardList";
import SearchBox from "./SearchBox";
import { robots } from "./Robots";

class App extends Component {
  constructor() {
    super();
    this.state = {
      robots: robots,
      searchfield: "",
    };
  }
  render() {
    return (
      <div>
        <h1>Robo Friends</h1>
        <SearchBox></SearchBox>
        <CardList robots={this.state.robots}></CardList>
      </div>
    );
  }
}

export default App;
